        case AccessibilityNodeInfo.ACTION_SELECT:
            {
                if (!isSelected()) {
                    setSelected(true);
                    return isSelected();
                }
            }
            break;
        case AccessibilityNodeInfo.ACTION_CLEAR_SELECTION:
            {
                if (isSelected()) {
                    setSelected(false);
                    return !isSelected();
